INSERT INTO [_Tmp_Translate] ([ID], [SchemaName], [TableName], [ColumnIdName], [ColumnId2Name], [TableID], [TableID2], [ColumnTidName], [TID], [Original], [DE], [FR], [IT]) VALUES (3483, N'dbo', N'XConfig', N'XConfigID', NULL, CONVERT(int, 740), NULL, N'DescriptionTID', 8371, N'Name der Datenbank. Beim Einloggen wird geprüft, ob der aktuelle Datenbank-Name mit diesem Wert übereinstimmt. Bei einer Nichtübereinstimmung kann der User nicht einloggen. Damit verhindern wir, dass versehentlich von einer Integrationsumgebung Dokumente auf der Produktionsumgebung mutiert, gelöscht oder eingefügt werden. Der erwartete Wert kann mit dem SQL "SELECT DB_NAME()" herausgefunden werden.', N'Name der Datenbank. Beim Einloggen wird geprüft, ob der aktuelle Datenbank-Name mit diesem Wert übereinstimmt. Bei einer Nichtübereinstimmung kann der User nicht einloggen. Damit verhindern wir, dass versehentlich von einer Integrationsumgebung Dokumente auf der Produktionsumgebung mutiert, gelöscht oder eingefügt werden. Der erwartete Wert kann mit dem SQL "SELECT DB_NAME()" herausgefunden werden.', N'Nom de la base de données. Lors de la connexion, le contrôle vérifie si le nom actuel de la base de données correspond à cette valeur. Si ce nest pas le cas, lutilisateur ne peut pas se connecter. Nous évitons ainsi que des documents soient mutés, supprimés ou insérés par mégarde depuis un environnement dintégration dans lenvironnement de production. La valeur attendue peut être trouvée avec le SQL « SELECT DB_NAME() ».', NULL)
