INSERT INTO [_Tmp_Translate] ([ID], [SchemaName], [TableName], [ColumnIdName], [ColumnId2Name], [TableID], [TableID2], [ColumnTidName], [TID], [Original], [DE], [FR], [IT]) VALUES (3502, N'dbo', N'XConfig', N'XConfigID', NULL, CONVERT(int, 571), NULL, N'DescriptionTID', 8407, N'Abteilungstyp, nach welchen die Institutionstypen und Institutionen zugeordnet werden können (primärer Filter). Siehe Werteliste "OrganisationsEinheitTyp" für mögliche Werte. Wird der Wert "-1" zugewiesen, erscheinen alle Abteilungen (sekundärer Filter wird nicht berücksichtigt).', N'Abteilungstyp, nach welchen die Institutionstypen und Institutionen zugeordnet werden können (primärer Filter). Siehe Werteliste "OrganisationsEinheitTyp" für mögliche Werte. Wird der Wert "-1" zugewiesen, erscheinen alle Abteilungen (sekundärer Filter wird nicht berücksichtigt).', N'Types de service selon lesquels les types dinstitution et les institutions sont attribués (filtre primaire). Voir la liste de valeur « TypeUnitéOrganisationnelle » pour les valeurs possibles. Si la valeur « -1 » est attribuée, tous les services apparaissent (le filtre secondaire nest pas pris en compte).', NULL)
INSERT INTO [_Tmp_Translate] ([ID], [SchemaName], [TableName], [ColumnIdName], [ColumnId2Name], [TableID], [TableID2], [ColumnTidName], [TID], [Original], [DE], [FR], [IT]) VALUES (3503, N'dbo', N'XConfig', N'XConfigID', NULL, CONVERT(int, 572), NULL, N'DescriptionTID', 8409, N'Abteilungstyp, nach welchen die Institutionstypen und Institutionen zusätzlich zugeordnet werden können (sekundärer Filter). Siehe Werteliste "OrganisationsEinheitTyp" für mögliche Werte. Wird der Wert "-1" zugewiesen, erscheinen die Abteilungen gemäss der Definition des primären Filters.', N'Abteilungstyp, nach welchen die Institutionstypen und Institutionen zusätzlich zugeordnet werden können (sekundärer Filter). Siehe Werteliste "OrganisationsEinheitTyp" für mögliche Werte. Wird der Wert "-1" zugewiesen, erscheinen die Abteilungen gemäss der Definition des primären Filters.', N'Types de service selon lesquels les types dinstitution et les institutions sont attribués en plus (filtre secondaire). Voir la liste de valeur « TypeUnitéOrganisationnelle » pour les valeurs possibles. Si la valeur « -1 » est attribuée, tous les services apparaissent selon la définition du filtre primaire.', NULL)
